import{_ as a}from"./chunks/index.VAya1KE4.js";import{c as p,o as s,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const r=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":500291,"idList":[504621,504570,504440,501214,503614,501157,501213,6489,3386,1058,1433,1056,1220,1498,503613,503612,4074,4073,500207,1290,502928,502927,5111,1627,502306,500987,501624,2404,501625,501626,2142,4334,6180,59,75,1057,501441,4081,500419,5020,500291,5865,500286,6937,500673,4780,5494,3875,3564,3276,1360,2040,57,2123,2403,2124,55,111,1744,501212,500672,500605,500292,7257,6938,6594,6490,6285,5866,5493,5297,4781,4736,4333,4197,4148,3387,3275,2606,2125,2402,78,382,105,92,241,1221,54,644,56,61,112,76,79,1055,1291,1795,2415],"data":{"id":500291,"name":"芙宁娜","summary":"芙宁娜","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2024/07/16/195563531/376ed8406d6315d5a77f4cdd5e917b9b_7215590901861641475.png","avatar":{"m":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/04/4328207/4fbd08a31b45c2c9d91ab192c9525069_8759509634908386115.png","pc":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/04/4328207/79eeec05554ff7952fdc4ad07b9157d8_3301894860568232941.png"},"attrs":[["地区","枫丹廷"],["星级","五星"],["神之眼所属","枫丹"],["元素","水"],["武器","单手剑"],["始基力","荒"],["始基力","芒"],["生日","10月13日"],["所属","枫丹廷"],["定位","多功能辅助角色"],["武器类型","单手剑"],["命之座","司颂座"],["称号","不休独舞"]],"destiny":[["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/501f9a0c43014939858a513cc5bc6592_505612894113315406.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/501f9a0c43014939858a513cc5bc6592_505612894113315406.png\\" style=\\"width: 40px; border: \\"></span></span></span>「爱是难驯鸟，哀乞亦无用。」</p>","<p>施放万众狂欢时，芙宁娜获得150点「气氛值」。</p><p>此外，芙宁娜持有「气氛值」的上限提升100点。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/e4717b2aa54a966af5363e538c171d60_4953979100514712397.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/e4717b2aa54a966af5363e538c171d60_4953979100514712397.png\\" style=\\"width: 40px; border: \\"></span></span></span>「女人皆善变，仿若水中萍。」</p>","<p>万众狂欢持续期间，芙宁娜通过队伍中附近角色的当前生命值提升或降低的方式获得的「气氛值」提升250%。</p><p>基于「气氛值」超过上限的部分，每1点「气氛值」都将使芙宁娜的生命值上限提升0.35%。</p><p>至多通过这种方式使芙宁娜的生命值上限提升140%。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/0b53d78bbb79d6873c830f5b0c711e49_2812545614142049971.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/0b53d78bbb79d6873c830f5b0c711e49_2812545614142049971.png\\" style=\\"width: 40px; border: \\"></span></span></span>「秘密藏心间，无人知我名。」</p>","<p>万众狂欢的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/a1009ed0bb134db8f784dd48eb575f2c_3904612769210744728.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/a1009ed0bb134db8f784dd48eb575f2c_3904612769210744728.png\\" style=\\"width: 40px; border: \\"></span></span></span>「若非处幽冥，怎知生可贵！」</p>","<p>孤心沙龙的「沙龙成员」命中敌人，或「众水的歌者」为周围的当前场上角色恢复生命值时，芙宁娜获得4点元素能量，该效果每5秒至多触发一次。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/855e54f3a03d0e16f78a13db38cfc34a_4786404088546655805.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/855e54f3a03d0e16f78a13db38cfc34a_4786404088546655805.png\\" style=\\"width: 40px; border: \\"></span></span></span>「我已有觉察，他名即是…！」</p>","<p>孤心沙龙的技能等级提高3级。</p><p>至多提升至15级。</p>"],["<p><span class=\\"custom-image-view\\" data-image-url=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/882eeb3948519818c1d8d7026645fe85_7815561945271291581.png\\" data-image-unit=\\"px\\" data-image-width=\\"40\\"><span class=\\"custom-image-wrapper\\" style=\\"width: 40px\\"><span style=\\"\\"><img class=\\"custom-image\\" src=\\"https://act-upload.mihoyo.com/wiki-user-upload/2024/01/08/80663279/882eeb3948519818c1d8d7026645fe85_7815561945271291581.png\\" style=\\"width: 40px; border: \\"></span></span></span>「诸君听我颂，共举爱之杯！」</p>","<p>施放元素战技「孤心沙龙」时，芙宁娜将获得「万众瞩目」，持续10秒。</p><p>持续期间，芙宁娜的普通攻击、重击与下落攻击将转为无法被附魔覆盖的水元素伤害，且造成的伤害提升，提升值相当于芙宁娜生命值上限的18%。</p><p>持续期间，每0.1秒，芙宁娜的普通攻击、重击与下落攻击坠地冲击命中敌人后，将根据芙宁娜当前的始基力属性产生不同的效果：</p><p>始基力：荒性</p><p>每1秒，基于芙宁娜生命值上限的4%，为附近的队伍中所有角色恢复生命值，持续2.9秒，重复触发将延长持续时间。</p><p></p><p>始基力：芒性</p><p>本次普通攻击、重击与下落攻击坠地冲击造成的伤害进一步提高，提升值相当于芙宁娜生命值上限的25%，上述攻击命中敌人时，附近的队伍中所有角色将消耗相当于当前生命值1%的生命值。</p><p>一次「万众瞩目」持续期间，上述效果至多触发6次，该效果将在触发次数达到6次或持续时间结束时解除。</p>"]],"skill":[{"title":"普通攻击·独舞之邀","desc":"\\n普通攻击\\n进行至多四段的连续攻击。\\n\\n重击\\n消耗一定体力，释放独舞的气场，对附近的敌人造成物理伤害，并切换自身的始基力属性。\\n如果场上存在元素战技「孤心沙龙」召唤的「沙龙成员」或「众水的歌者」，「沙龙成员」或「众水的歌者」也会更换为对应的阵容。\\n\\n始基力：圣俗杂座\\n每隔一段时间，芙宁娜的普通攻击命中时，将根据芙宁娜当前的始基力属性，在命中的位置降下灵息之刺或流涌之刃，造成具有芒性或荒性的水元素伤害。\\n芙宁娜登场时，始基力属性为荒性。\\n\\n下落攻击\\n从空中下坠冲击地面，攻击下落路径上的敌人，并在落地时造成范围伤害。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/06/4328207/315720c617d6918daf487b934243da0f_7953189815330232623.png"},{"title":"孤心沙龙","desc":"邀请孤心沙龙的客人们上阵，为芙宁娜的演出助兴。\\n根据芙宁娜当前的始基力属性，邀请的客人分为「沙龙成员」与「众水的歌者」。\\n\\n荒性\\n挥洒欢庆的泡沫，基于芙宁娜的生命值上限，造成水元素范围伤害，并召唤三位「沙龙成员」：球球章鱼形态的「乌瑟勋爵」、泡泡海马形态的「海薇玛夫人」和重甲蟹形态的「谢贝蕾妲小姐」。\\n「沙龙成员」将间歇性攻击附近的敌人，并优先攻击当前场上角色的目标，基于生命值上限，造成水元素伤害。\\n「沙龙成员」进行攻击时，根据附近的队伍中生命值高于50%的角色数量，提升此次攻击的威力，并消耗这些角色的生命值：满足条件的角色数量为1/2/3/4名或更多时，攻击造成的伤害为原本的110%/120%/130%/140%。\\n\\n芒性\\n召唤「众水的歌者」，每隔一段时间，受益于生命值上限，为周围的当前场上角色恢复生命值。\\n\\n「沙龙成员」与「众水的歌者」共享持续时间，芙宁娜通过重击更换客人的阵容时，将继承持续时间。\\n「沙龙成员」或「众水的歌者」存在期间，芙宁娜能够在水面上移动。\\n\\n芙宁娜的孤心沙龙总有固定成员到访。\\n其他时候都是谢贝蕾妲小姐、海薇玛夫人和乌瑟勋爵，而忧郁的星期三出现的则是歌者。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/06/4328207/0e02fe04e0cd746427a856942626d5b1_4405556220620426665.png"},{"title":"万众狂欢","desc":"凝聚狂欢之意，构筑水沫的舞台，基于芙宁娜的生命值上限，造成水元素范围伤害，并使队伍中附近的角色进入「普世欢腾」状态：持续期间，角色的当前生命值提升或降低时，基于提升或降低数值相对于生命值上限的比例，每1%都将使芙宁娜获得1点「气氛值」。\\n同时，基于芙宁娜持有的「气氛值」，附近的队伍中所有角色造成的伤害提升，受治疗加成提升。\\n持续时间结束时，芙宁娜持有的「气氛值」将被移除。\\n\\n「喝彩吧！赞美吧！刮目相看吧！举起酒杯吧！每个没有欢宴的夜晚都是对痛苦、清醒白日的浪费…呃，那，没成年的就换成葡萄汁！」","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/06/4328207/4c6e28db1a9aaeeb4f80adad3579b0b9_7129999377595032643.png"},{"title":"停不了的圆舞","desc":"队伍中当前场上的角色受到治疗时，若这次治疗的来源不是芙宁娜自己并且治疗回复量溢出，在接下来的4秒内，芙宁娜每2秒将为队伍中附近的角色恢复一次生命值，回复量相当于角色各自生命值上限的2%。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/06/4328207/353d1f9f76efbbe2ec99e6f9b4c1081f_7350359417234149654.png"},{"title":"无人听的自白","desc":"每1000点生命值上限都将使处于不同始基力属性下的芙宁娜的孤心沙龙获得相应的增益效果：\\n「沙龙成员」造成的伤害提升0.7%，通过这种方式至多使「沙龙成员」造成的伤害提升28%；\\n「众水的歌者」为周围的当前场上角色恢复生命值的间隔降低0.4%，通过这种方式至多使「众水的歌者」为周围的当前场上角色恢复生命值的间隔降低16%。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/06/4328207/cc97be7cc922f279b38745823189e149_5681126528220324802.png"},{"title":"瀚海亦舞台","desc":"异色原海异种能力的冷却时间降低30%。","icon":"https://act-upload.mihoyo.com/wiki-user-upload/2023/11/06/4328207/ab98e19d7ec47438d595f60f30987e96_6320758171585499767.png"}]},"favModalLocalKey":"vitepress_game_ys_role_fav_modal","favLocalKey":"vitepress_game_ys_role_fav"},"relativePath":"game/ys/role/500291.md","filePath":"game/ys/role/[pkg].md"}'),i={name:"game/ys/role/500291.md"},g=Object.assign(i,{setup(o){return(c,d)=>(s(),p("div",null,[e(t(a))]))}});export{r as __pageData,g as default};
